Room-temperature compressive stress–strain curves of consolidated Al0.6CoNiFe and Ti0.4Al0.6CoNiFe alloys are shown in 
                        Fig. 9. The yield strength (σ

                           y
                        ), compressive strength (σ

                           max
                        ) and strain-to-failure (ε

                           f
                        ) and Vickers hardness values of the studied alloys are listed in 
                        Table 3. The HP’ed Al0.6CoNiFe and HP’ed Ti0.4Al0.6CoNiFe alloys show high strength and high hardness. The compressive strength of the former and the latter is 2913MPa and 2737MPa, respectively. The average Vickers hardness of the former and the latter is 865 and 816HV, respectively. However, the compressive strain-to-failure is very small for these two HP’ed alloys, indicating limited compressive plasticity.
